import React from 'react';
import MapMarker from '../images/MapMarker';
function OrphanagesMap(){
  return(
    <div className="page-map">
      <aside>
        <header>
          <img src={MapMarker} alt="Marcador"></img>
        </header>
      </aside>
    </div>
  )
}
export default OrphanagesMap;
